import React from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
import './App.css';
import data from './animearchive.json'
import { unstable_batchedUpdates } from 'react-dom';

function App() {
  return (


(<div>

<div class="Panel1"> 

  <input type="text" placeholder="Search Anime" id="DirectorySearch" class="Searchbar"></input>

   </div>



</div>)
  );
}

for (const [key,value] of Object.entries(data)) {

const LoadElement = (
<li> <a href={value.Direct}> {value.Pagename} </a> </li>
);

ReactDOM.render(LoadElement, document.getElementById('root'));

}





export default App;
